// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/extensions/AccessControlEnumerable.sol";

import "./interfaces/IRoomCoin.sol";

contract RoomCoin is IRoomCoin, AccessControlEnumerable, ERC20 {
  bytes32 public constant RMC_PAIR_ROLE = keccak256("RMC_PAIR_ROLE");
  uint256 public constant MAX_BLOCK_TIMEOUT = 28800;  // ~1 day
  uint256 public constant MAX_FEE_AMOUNT = 5;         // 5%

  uint256 public startBlock;
  uint256 public fee;
  uint256 public blockTimeout;
  uint256 public deadBlocks;
  uint256 public maxTxAmount;
  bool public isTradingEnabled;
  bool public antibot;

  mapping(address => bool) public isBlacklisted;
  mapping(address => bool) public isWhitelisted;
  mapping(address => bool) public isDisabledFee;
  mapping(address => uint256) public lastTransfer;


  constructor(address initialOwner_) 
    ERC20('Room Coin', 'RMC')
  {
    _grantRole(DEFAULT_ADMIN_ROLE, initialOwner_);

    super._update(address(0), initialOwner_, 10_000_000 * 10 ** decimals());

    _setIsWhitelisted(initialOwner_, true);
    _setIsDisabledFee(initialOwner_, true);
    _setIsWhitelisted(address(this), true);

    fee = 2;
    blockTimeout = 10;
    deadBlocks = 5;
    maxTxAmount = 1_000_000 * 10 ** decimals();
    antibot = true;
  }

  function openTrade() public onlyRole(DEFAULT_ADMIN_ROLE) {
    if (isTradingEnabled) revert("RoomCoin: Trading is already enabled");

    isTradingEnabled = true;
    startBlock = block.number;

    emit OpenTrade(startBlock);
  }

  function setFee(uint256 fee_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    if (fee_ > MAX_FEE_AMOUNT) revert("RoomCoin: Wronf fee amount");

    fee = fee_;

    emit SetFee(fee_);
  }

  function setBlockTimeout(uint256 blockTimeout_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    if (blockTimeout_ > MAX_BLOCK_TIMEOUT) revert("RoomCoin: Block timeout can't be more when 1 day");

    blockTimeout = blockTimeout_;

    emit SetBlockTimeout(blockTimeout_);
  }

  function setDeadBlocks(uint256 deadBlocks_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    deadBlocks = deadBlocks_;

    emit SetDeadBlocks(deadBlocks_);
  }

  function setMaxTxAmount(uint256 amount_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    if (amount_ > totalSupply()) revert("RoomCoin: Max tx amount can't be more than total supply");
    if (amount_ == 0) revert("RoomCoin: Max tx amount can't be zero");

    maxTxAmount = amount_;

    emit SetMaxTxAmount(amount_);
  }

  function setAntibot(bool value_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    antibot = value_;

    emit SetAntibot(value_);
  }

  function setIsWhitelisted(address account_, bool value_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    _setIsWhitelisted(account_, value_);
  }

  function setBanchIsWhitelisted(address[] calldata accounts_, bool value_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    for (uint256 i = 0; i < accounts_.length; i++) {
      _setIsWhitelisted(accounts_[i], value_);
    }
  }

  function setIsBlacklisted(address account_, bool value_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    _setIsBlacklisted(account_, value_);
  }

  function setBanchIsBlacklisted(address[] calldata accounts_, bool value_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    for (uint256 i = 0; i < accounts_.length; i++) {
      _setIsBlacklisted(accounts_[i], value_);
    }
  }

  function setIsDisabledFee(address account_, bool value_) public onlyRole(DEFAULT_ADMIN_ROLE) {
    _setIsDisabledFee(account_, value_);
  }

  function decimals() public view override(ERC20, IRoomCoin) returns (uint8) {
    return super.decimals();
  }

  function burn(uint256 amount_) public returns (bool) {
    super._update(msg.sender, address(0), amount_);
    return true;
  }

  function _update(address from_, address to_, uint256 value_) internal override {
    uint value = value_;

    if (!isWhitelisted[from_] && !isWhitelisted[to_]) {
      if (!isTradingEnabled) revert("RoomCoin: Trading is disabled");
      if (isBlacklisted[from_] || isBlacklisted[to_]) revert("RoomCoin: Blacklisted address");
      if (value > maxTxAmount) revert("RoomCoin: Amount must be lower maxTxAmount");
      if (hasRole(RMC_PAIR_ROLE, from_)) {
        lastTransfer[to_] = block.number;
        if (antibot) _antibot(to_);
      }
      if (hasRole(RMC_PAIR_ROLE, to_)) {
        if(lastTransfer[from_] + blockTimeout > block.number) revert("RoomCoin: Not time yet");
        if (antibot) _antibot(from_);
      }

      if(!isDisabledFee[from_] && fee != 0) {
        uint256 feeAmount = value * fee / 100;
        super._update(from_, address(0), feeAmount);
        value -= feeAmount;
      }
    }

    super._update(from_, to_, value);
  }

  function _antibot(address account) private {
    if (startBlock + deadBlocks >= block.number) {
      _setIsBlacklisted(account, true);
    } else {
      antibot = false;
    }
  }

  function _setIsWhitelisted(address account_, bool value_) private {
    isWhitelisted[account_] = value_;

    emit SetIsWhitelisted(account_, value_);
  }

  function _setIsBlacklisted(address account_, bool value_) private {
    isBlacklisted[account_] = value_;

    emit SetIsBlacklisted(account_, value_);
  }

  function _setIsDisabledFee(address account_, bool value_) private {
    isDisabledFee[account_] = value_;

    emit SetIsDisabledFee(account_, value_);
  }
}

contracts/vesting/StrategicRoundLock.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "../interfaces/IRoomCoin.sol";

import "hardhat/console.sol";

contract StrategicRoundLock is Ownable {
  using SafeERC20 for ERC20;

  uint256 constant public unlockPeriod = 2592000;     // 2592000 - 30 days in seconds
  uint256 constant public percentDeniminator = 10000; // 10000 = 100,00%
  uint256 constant public tgePercent = 500;           // 500 = 5,00%
  uint256 constant public unlockPercent = 396;        // 396 = 3,96%
  uint256 constant public cliff = 4;
  uint256 constant public marketingPercent = 2500;    // 2500 = 25,00%
  uint256 constant public teamPercent = 1670;         // 1670 = 16,70%
  uint256 constant public reservePercent = 1670;      // 1670 = 16,70%
  uint256 constant public liquidityPercent = 4160;    // 4160 = 41,60%
  uint256 constant public priceDeniminator = 100;     // 100 = 1,00$
  uint256 constant public tokenPriceUSD = 40;         // 40 = 0,40$
  uint256 constant public maxUsdAmount = 2000000;     // 2000000 = 20000,00$
  uint256 constant public minUsdAmount = 500000;      // 500000 = 5000,00$

  mapping(address => uint256) public balance;
  mapping(address => uint256) public claimedByUser;
  mapping(address => uint256) public balanceInUSD;

  uint256 public avalableToClaimGlobal;
  uint256 public tokensSoldAmount;
  uint256 public tokensSoldAmountMax;
  uint256 public nextUnlock;
  uint256 public startUnlock;
  bool public seedIsStarted;
  bool public vestingIsStarted;
  address public marketingAddress;
  address public teamAddress;
  address public reserveAddress;
  address public liquidityAddress;

  IRoomCoin private _token;
  ERC20 private _usd;

  event Claim(address indexed _claimer, uint256 _amount);
  event Buy(address indexed _spender, uint256 _amountreceive, uint256 _amountsend);
  event Phase(address indexed _activator, string _typeoperation);

  constructor(
    address initialOwner_, 
    address tokenAddress_, 
    address usdAddress_,
    address marketingAddress_, 
    address teamAddress_, 
    address reserveAddress_,
    address liquidityAddress_
  ) Ownable(initialOwner_) {
    _token = IRoomCoin(tokenAddress_);
    _usd = ERC20(usdAddress_);
    marketingAddress = marketingAddress_;
    teamAddress = teamAddress_;
    reserveAddress = reserveAddress_;
    liquidityAddress = liquidityAddress_;
  }

  function startSeed() public onlyOwner() {
    require(tokensSoldAmountMax == 0);
    require(_token.balanceOf(address(this)) != 0);
    require(!seedIsStarted);
    seedIsStarted = true;
    tokensSoldAmountMax = _token.balanceOf(address(this));
    emit Phase(msg.sender, string("start"));
  }

  function stopSeed() public onlyOwner() {
    require(seedIsStarted);
    seedIsStarted = false;
    emit Phase(msg.sender, string("stop"));
  }

  function resumeSeed() public onlyOwner() {
    require(tokensSoldAmountMax != 0);
    require(!seedIsStarted);
    seedIsStarted = true;
    emit Phase(msg.sender, string("resume"));
  }

  function startVesting() public onlyOwner() {
    require(!seedIsStarted);
    require(!vestingIsStarted);
    vestingIsStarted = true;
    startUnlock = block.timestamp;
    nextUnlock = startUnlock + (unlockPeriod * cliff);
    avalableToClaimGlobal = tgePercent;
    uint256 burnAmount = tokensSoldAmountMax - tokensSoldAmount;
    _token.burn(burnAmount);
    emit Phase(msg.sender, string("startVesting"));
  }

  function buy(uint256 amountUSD_) public {
    console.log('---', tokensSoldAmount, tokensSoldAmountMax, seedIsStarted);
    require(tokensSoldAmount < tokensSoldAmountMax);
    require(seedIsStarted);
    if (balance[msg.sender] == 0) {
      require(amountUSD_ >= minUsdAmount * 10 ** _usd.decimals() / priceDeniminator);
      require(amountUSD_ <= maxUsdAmount * 10 ** _usd.decimals() / priceDeniminator);
    }
    require(balanceInUSD[msg.sender] + amountUSD_ <= maxUsdAmount * _usd.decimals() / priceDeniminator);
    uint256 tokenAmount = amountUSD_ * 10 ** _token.decimals() * priceDeniminator / (tokenPriceUSD * 10 ** _usd.decimals());
    require(tokenAmount <= tokensSoldAmountMax - tokensSoldAmount);
    _usd.safeTransferFrom(msg.sender, address(this), amountUSD_);
    balanceInUSD[msg.sender] += amountUSD_;
    balance[msg.sender] += tokenAmount;
    tokensSoldAmount += tokenAmount;
    uint256 minTokenAmount = minUsdAmount / tokenPriceUSD * _token.decimals();
    emit Buy(msg.sender, tokenAmount, amountUSD_);
    if (tokensSoldAmountMax - tokensSoldAmount < minTokenAmount) stopSeed();
  }

  function claim() public {
    require(vestingIsStarted);
    require(balance[msg.sender] > 0);
    if (block.timestamp > nextUnlock) {
      avalableToClaimGlobal += unlockPercent;
      if (avalableToClaimGlobal == percentDeniminator) {
        nextUnlock = ~uint256(0);
      } else {
        nextUnlock = block.timestamp + unlockPeriod;
      }
    }
    uint256 _avalableToClaim = avalableToClaimGlobal - claimedByUser[msg.sender];
    require(_avalableToClaim > 0);
    uint256 _amount = balance[msg.sender] * _avalableToClaim / percentDeniminator;
    claimedByUser[msg.sender] += _avalableToClaim;
    _token.transfer(msg.sender, _amount);
    emit Claim(msg.sender, _amount);
  }

  function distributionBUSD() public onlyOwner() {
    uint256 _totalBalanceBUSD = _usd.balanceOf(address(this));
    require(_totalBalanceBUSD > 0);
    require(!seedIsStarted);
    uint256 _marketingAmount = _totalBalanceBUSD * marketingPercent / percentDeniminator;
    uint256 _teamAmount = _totalBalanceBUSD * teamPercent / percentDeniminator;
    uint256 _reserveAmount = _totalBalanceBUSD * reservePercent / percentDeniminator;
    uint256 _liquidityAmount = _totalBalanceBUSD * liquidityPercent / percentDeniminator;
    _usd.safeTransfer(marketingAddress, _marketingAmount);
    _usd.safeTransfer(teamAddress, _teamAmount);
    _usd.safeTransfer(reserveAddress, _reserveAmount);
    _usd.safeTransfer(liquidityAddress, _liquidityAmount);
    emit Phase(msg.sender, string("distributionBUSD"));
  }
}

